import React from 'react'
import Wave from 'react-wavify'

class ShowDays extends React.Component{
    render(){
        return(
            <div style={{width: '300px', height: '300px'}}>
                <Wave fill="#e62315" mask="url(#mask)" options={{ points: 5, speed: 0.2, amplitude: 10 }}>
                {/* Example adapted from https://developer.mozilla.org/en-US/docs/Web/SVG/Element/mask */}
                {/* <mask id="mask">
                    <path d="M10,35 A20,20,0,0,1,50,35 A20,20,0,0,1,90,35 Q90,65,50,95 Q10,65,10,35 Z" fill="white" />
                </mask> */}
                <mask id="myMask">
    <rect x="0" y="0" width="100" height="100" fill="white" />

    <path d="M10,35 A20,20,0,0,1,50,35 A20,20,0,0,1,90,35 Q90,65,50,95 Q10,65,10,35 Z" fill="blue" />
  </mask>

                </Wave>
                <svg viewBox="-10 -10 120 120">
  <mask id="myMask">
    <rect x="0" y="0" width="100" height="100" fill="white" />

    <path d="M10,35 A20,20,0,0,1,50,35 A20,20,0,0,1,90,35 Q90,65,50,95 Q10,65,10,35 Z" fill="blue" />
  </mask>

  {/* <polygon points="-10,110 110,110 110,-10" fill="orange" /> */}

  <circle cx="25" cy="50" r="50" />
</svg>
            </div>
        )
    }
}

export default ShowDays;
